void PPort_OCP2EVLS::Start()
{
    m_logger.LogVerbose() << "PPort_OCP2EVLS::Start";
    
    // construct skeleton
    ara::core::InstanceSpecifier specifier{"Exe_obstaclecruiseplanner/AA/PPort_OCP2EVLS"};
    m_interface = std::make_unique<oss::srv::OCP2EVLS::skeleton::EVLS_SI_obstaclecruiseplannerSkeletonImpl>(specifier);
    
    // offer service
    auto offer = m_interface->OfferService();
    if (offer.HasValue())
    {
        m_running = true;
        m_logger.LogVerbose() << "PPort_OCP2EVLS::Start::OfferService";
    }
    else
    {
        m_running = false;
        m_logger.LogError() << "PPort_OCP2EVLS::Start::OfferService::" << offer.Error().Message();
    }
}
 
void PPort_OCP2EVLS::Terminate()
{
    m_logger.LogVerbose() << "PPort_OCP2EVLS::Terminate";
    
    // stop port
    m_running = false;
    
    // stop offer service
    m_interface->StopOfferService();
    m_logger.LogVerbose() << "PPort_OCP2EVLS::Terminate::StopOfferService";
}
 
